import styled from "styled-components";

const ImgContainer = styled.div`
    position:relative;
    width:250px;
    height:250x;
    background:linear-gradient(lime,red);
`;


function AnimalControl({item}) {
  console.log(item.Name);
  return (
    <div>
      <h3>{item.Name}</h3>
    </div>
  )
}

export default AnimalControl;
